import React, { useState } from "react";

import Thumbnail from "../img/12.png";
import Thumbnail35 from "../img/055.jpg";
import Thumbnail2 from "../img/13.png";
import Thumbnail3 from "../img/14.png";
import Thumbnail4 from "../img/15.png";
import ItemsUnit from "./ItemsUnit";

const SimpleItems = [
  {
    id: "1",
    name: "Longines",
    tag: "watches",
    Thumbnail: Thumbnail35,
  },
  {
    id: "2",
    name: "Longines",
    tag: "watches",
    Thumbnail: Thumbnail2,
  },
  {
    id: "3",
    name: "Longines",
    tag: "watches",
    Thumbnail: Thumbnail3,
  },
  {
    id: "4",
    name: "Longines",
    tag: "watches",
    Thumbnail: Thumbnail4,
  },
];

const ItemsList = () => {
  const [items, setItems] = useState(SimpleItems);
  return (
    <section className="items">
      {items.map((id, name, tag, Thumbnail) => (
        <ItemsUnit key={id} name={name} image={Thumbnail} tag={tag} />
      ))}
    </section>
  );
};

export default ItemsList;
